import React from 'react';
import Login from './Login';
import Register from './Register';

const Header = () => {
  return (
        <header>
            <a href='#logo' className='logo'>MyBlog</a>
            <nav>
                <a href={Login}>Log in</a>
                <a href={Register}>Register</a>
            </nav>
        </header>
    )
}

export default Header
